BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "song" (
	"id"	INTEGER,
	"title"	TEXT NOT NULL,
	"filename"	TEXT UNIQUE,
	"album_id"	INTEGER,
	"artist_id"	INTEGER,
	"length"	REAL,
	FOREIGN KEY("album_id") REFERENCES "album"("id"),
	FOREIGN KEY("artist_id") REFERENCES "artist"("id"),
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "playlist_songs" (
	"playlist_id"	INTEGER,
	"song_id"	INTEGER,
	UNIQUE("playlist_id","song_id"),
	FOREIGN KEY("song_id") REFERENCES "song"("id"),
	FOREIGN KEY("playlist_id") REFERENCES "playlist"("id")
);
CREATE TABLE IF NOT EXISTS "shift_connection" (
	"shift_id"	INTEGER NOT NULL,
	"playlist_1_id"	INTEGER NOT NULL,
	"playlist_2_id"	INTEGER NOT NULL,
	"weight"	INTEGER NOT NULL CHECK("weight" > 0 AND "weight" <= 1),
	"combined_columns"	TEXT GENERATED ALWAYS AS (CASE WHEN "playlist_1_id" < "playlist_2_id" THEN "playlist_1_id" || "playlist_2_id" || "shift_id" ELSE "playlist_2_id" || "playlist_1_id" || "shift_id" END) VIRTUAL,
	FOREIGN KEY("playlist_1_id") REFERENCES "playlist"("id"),
	FOREIGN KEY("playlist_2_id") REFERENCES "playlist"("id"),
	FOREIGN KEY("shift_id") REFERENCES "shift"("id")
);
CREATE TABLE IF NOT EXISTS "playlist" (
	"id"	INTEGER,
	"playlist"	TEXT NOT NULL UNIQUE,
	"weight"	REAL NOT NULL CHECK("weight" <= 1 AND "weight" > 0),
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "artist" (
	"id"	INTEGER,
	"artist"	TEXT NOT NULL UNIQUE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "album" (
	"id"	INTEGER,
	"album"	TEXT NOT NULL UNIQUE,
	"cover_art"	BLOB,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "shift" (
	"id"	INTEGER,
	"shift"	TEXT NOT NULL UNIQUE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE UNIQUE INDEX IF NOT EXISTS "idx_unique_combination_shift" ON "shift_connection" (
	"combined_columns"
) WHERE "shift_id" IS NOT NULL;
COMMIT;
